import React from "react";

import city from "../../data/city.json";

const City = () => {
  return (
    <div className="container">
      {city.map((city) => {
        <img src={city.image} alt=""></img>;
        <p>{city.name}</p>;
      })}
    </div>
  );
};
export default City;
